import User from "../../models/USER-model";
import {observer} from "mobx-react-lite"

const MainPAge = () => {
    const user = new User();
    useEffect(() => {
        async function fetchData(){
            user.checkAuth();
        }
        fetchData();
        console.log(user.isAuth);
    }, [])
    
    return(<Fragment>
        <h1>Main page {user.isAuth? "U are in!": "Pls log In!"}</h1>
    </Fragment>);
}

export default MainPAge;
